const ContactApp = ({ data }) => {
  console.log(data.lastName);
  return (
    <div key={data.id}>
      Name: {data.firstName} {data.lastName}
      <br></br>Number: {data.phoneNum}
      <button>Kişi Güncelleme</button>
      <hr></hr>
    </div>
  );
};

export default ContactApp;
